import Post from "./Posts.jsx";

function Feed() {
    return (
    <div className="overflow-y-scroll">
        <div className="flex justify-center">
            {/* Button */}
            <div className="transition delay-50 flex m-2 sm:m-3 py-2 px-4 items-center cursor-pointer bg-gray-700 font-bold rounded-full hover:bg-cyan-400 shadow-xl">
                <PlusIcon className="p-0.5 h-7 text-white"/>
                <p className="text-white">Social Post</p>
            </div>

        </div>

       <Posts/>

    </div>
    )
}

export default Feed;
